async function signUrl(req, res) {
  try {
    const originalUrl = req.body.urlForSignature;

    const signature = crypto
      .createHmac('sha256', MOONPAY_API_KEY )  // Use your secret key here
      .update(new URL(originalUrl).search)  // Use the query string part of the URL
      .digest('base64');  // Convert the result to a base64 string

    // const urlWithSignature = `${originalUrl}&signature=${encodeURIComponent(signature)}`;  // Add the signature to the URL

    res.status(200).json({signature});
  } catch (error) {
    console.error('Error signing url:', error);
    res.status(500).json({ message: 'Error signing url' });
  }
}

async function listCurrencies(req, res) {
  try {

    const options = {
      method: 'GET',
      url: `https://api.moonpay.com/v3/currencies?apiKey=${MOONPAY_API_KEY}`,
      headers: { accept: 'application/json' }
    };
    const data = (await axios.request(options)).data;

    const normalize = () => {
      const fiatCurrencies = [];
      const cryptoCurrencies = [];

      data.forEach(item => {
        const icon = ICONS[item.code.toUpperCase()];
        const commonFields = {
          code: item.code,
          icon: icon,
          precision: item.precision,
        };

        if (item.type === 'fiat') {
          fiatCurrencies.push({
            label: item.code,
            icon: icon,
            precision: item.precision,
            minBuyAmount: item.minBuyAmount,
            maxBuyAmount: item.maxBuyAmount,
          });
        } else if (item.type === 'crypto') {
          cryptoCurrencies.push(commonFields);
        }
      });

      return {
        fiatCurrencies,
        cryptoCurrencies,
      };
    }

    const result = normalize(data)

    res.status(200).json(result);
  } catch (error) {
    console.error('Error fetching user notifications:', error);

    if (DEBUG) {

    }

    res.status(500).json({ message: 'Error fetching user notifications' });
  }
}

async function getRate(req, res) {
  try {

    const { crypto: cryptoCurr, fiat, amount } = req.query;
    const options = {
      method: 'GET',
      url: `https://api.moonpay.com/v3/currencies/${cryptoCurr.toLowerCase()}/buy_quote?baseCurrencyAmount=${amount}&baseCurrencyCode=${fiat}&areFeesIncluded=true&apiKey=${MOONPAY_API_KEY}`,
      headers: { accept: 'application/json' }
    };

    
    const data = (axios.request(options)).data;

    res.status(200).json({
      code: 200,
      message: "success",
      data: {
        price: data.quoteCurrencyPrice,
        fiatAmount: data.baseCurrencyAmount,
        cryptoAmount: data.quoteCurrencyAmount,
        fiatCurrency: data.baseCurrencyCode,
        cryptoCurrency: data.quoteCurrencyCode,
        totalFee: data.feeAmount,
      }
    });
  } catch (error) {
    console.error('Error getting buy quotes', error);
    if (DEBUG) {

      res.status(200).json({
        code: 200,
        message: "success",
        data: {
          price: 1,
          fiatAmount: amount,
          cryptoAmount: data.quoteCurrencyAmount,
          fiatCurrency: fiat,
          cryptoCurrency: cryptoCurr,
          totalFee: 3.99,
        }
      });
    } else {
      res.status(500).json({ message: 'Error fetching user notifications' });
    }
   
  }
}

async function moonPayWebHook(req, res) {
  try {
    const signatureHeader = req.headers['moonpay-signature-v2'];
    if (!signatureHeader) {
      return res.status(400).json({ message: 'Missing signature header' });
    }

    const [timestampPart, signaturePart] = signatureHeader.split(',');
    const timestamp = timestampPart.split('=')[1];
    const signature = signaturePart.split('=')[1];

    const signedPayload = `${timestamp}.${JSON.stringify(req.body)}`;
    const expectedSignature = crypto
      .createHmac('sha256', MOONPAY_API_KEY)
      .update(signedPayload)
      .digest('hex');

    if (signature !== expectedSignature) {
      return res.status(400).json({ message: 'Invalid signature' });
    }

    const data = req.body;

    if (data.type === "transaction_created") {

      let buyOrder = await CryptoBuyOrder.find({
        trans_id: data.data.id,
        user_id: data.externalCustomerId,
      })

      if (!!buyOrder) {
        return res.status(200).json({ message: 'Duplicated' });
      }

      buyOrder = new CryptoBuyOrder({
        trans_id: data.data.id,
        user_id: data.externalCustomerId,
        walletAddress: data.data.walletAddress,
        fiat: data.data.baseCurrency.code,
        crypto: data.data.currency.code,
        cryptoAmount: data.data.quoteCurrencyAmount,
        fiatAmount: data.data.baseCurrencyAmount,
        feeAmount: data.data.feeAmount,
        paymentMethod: data.data.paymentMethod,
        status: "processing"
      })
      await buyOrder.save();
    } else if (data.type === "transaction_failed") {

      await CryptoBuyOrder.updateOne(
        { trans_id: data.data.id },
        { $set: { status: "failed" } }
      );

    } else {
      const options = {
        method: 'GET',
        url: `https://api.moonpay.com/v1/transactions/${data.data.id}?apiKey=${MOONPAY_API_KEY}`,
        headers: { accept: 'application/json' }
      };
      
      const response = (await axios.request(options)).data;
      if (response.status === "completed") { // Buy order completed
        // TODO: Maybe update user crypto Asset HERE
        await CryptoBuyOrder.updateOne(
          { trans_id: data.data.id },
          { $set: { status: "completed" } }
        );
      }

    }
    return res.status(200).json({ message: 'Success' });
  } catch (error) {
    console.log("Error IN MOON PAY WEBHOOK => ", error.message)
    return res.status(500).json({ message: error.message });
  }
}


async function getBuyOrderList(req, res) {
  try {
    const { page = 1, limit = 10, fiat, crypto, status, startDate, endDate } = req.query;

    const filters = {
      user_id: req.id,
    };

    if (fiat) filters.fiat = fiat;
    if (crypto) filters.crypto = crypto;
    if (status) filters.status = status;

    const currentDate = new Date();
    const defaultEndDate = new Date(currentDate.setDate(currentDate.getDate() + 7));
    filters.timestamp = {
      $gte: startDate ? new Date(startDate) : new Date(),
      $lte: endDate ? new Date(endDate) : defaultEndDate
    };

    const buyOrders = await CryptoBuyOrder.find(filters)
      .skip((page - 1) * limit)
      .limit(parseInt(limit));

    const total = await CryptoBuyOrder.countDocuments(filters);

    res.status(200).json({
      total,
      page,
      limit,
      totalPages: Math.ceil(total / limit),
      data: buyOrders
    });
  } catch (error) {
    console.error('Error getting buy list:', error);
    res.status(500).json({ message: 'Error fetching buy list' });
  }
}



module.exports = {
  signUrl,
  listCurrencies,
  getRate,
  moonPayWebHook,
  getBuyOrderList
};